function Join() {
  return (
    <div>
      <Headerplus />
      <div>
      <FitnessCenterIcon />
      <form>
       <h5>Email</h5>
       <input type='email'></input>
       <h5>Password</h5>
       <input type='password'></input>
       <button type='submit'>Sign In</button>
       <p>Now you can browse privately, and other people who use this device wonâ€™t see your activity. However, downloads, bookmarks and reading list items will be saved.</p>
       <button>Create Account with amazon</button>
      </form>
</div>
      <Down />
    </div>
  );
}

export default Join;
